import React, { Component } from "react";
import DemoTable from "./DemoTable";
import PropTypes from 'prop-types';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Tabs from '@material-ui/core/Tabs';
import Tab from '@material-ui/core/Tab';
import Typography from '@material-ui/core/Typography';
import Box from '@material-ui/core/Box';

class Tables extends Component {
  render() {
    return (

        <TabPanel />

    );
  }
}

function TabPanel(props) {
  const { children, value, index, ...other } = props;

  return (
    <div
      role="tabpanel"
      hidden={value !== index}
      id={`scrollable-auto-tabpanel-${index}`}
      aria-labelledby={`scrollable-auto-tab-${index}`}
      {...other}
    >
      {value === index && (
        <Box p={3}>
          <Typography>{children}</Typography>
        </Box>
      )}
    </div>
  );
}

TabPanel.propTypes = {
  children: PropTypes.node,
  index: PropTypes.any.isRequired,
  value: PropTypes.any.isRequired,
};

function a11yProps(index) {
  return {
    id: `scrollable-auto-tab-${index}`,
    'aria-controls': `scrollable-auto-tabpanel-${index}`,
  };
}

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
    width: '100%',
    backgroundColor: theme.palette.background.paper,
  },
}));

export default function ScrollableTabsButtonAuto() {
  const classes = useStyles();
  const [value, setValue] = React.useState(0);

  const handleChange = (event, newValue) => {
    setValue(newValue);
  };

  return (
    <div className={classes.root}>
      <AppBar position="static" color="default">
        <Tabs
          value={value}
          onChange={handleChange}
          indicatorColor="primary"
          textColor="primary"
          variant="scrollable"
          scrollButtons="auto"
          aria-label="scrollable auto tabs example"
        >
          <Tab label="Table One" {...a11yProps(0)} />
          <Tab label="Table Two" {...a11yProps(1)} />
          <Tab label="Table Three" {...a11yProps(2)} />
          <Tab label="Table Four" {...a11yProps(3)} />
          <Tab label="Table Five" {...a11yProps(4)} />
          <Tab label="Table Six" {...a11yProps(5)} />
          <Tab label="Table xx" {...a11yProps(8)} />
          <Tab label="Table xx" {...a11yProps(9)} />
          <Tab label="Table xx" {...a11yProps(10)} />
          <Tab label="Table xx" {...a11yProps(11)} />
          <Tab label="Table xx" {...a11yProps(12)} />
          <Tab label="Table xx" {...a11yProps(13)} />
          <Tab label="Table xx" {...a11yProps(14)} />

        </Tabs>
      </AppBar>
      <TabPanel value={value} index={0}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={1}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={2}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={3}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={4}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={5}>
        {/* <DemoTable /> */}
      </TabPanel>
      <TabPanel value={value} index={6}>
        {/* <DemoTable /> */}
      </TabPanel>
    </div>
  );
}
